__NUXT_JSONP__("/drugs/Vinfosiltine", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"123286-00-0",chebiId:"",chemicalFormula:"C51H72N5O10P",definition:"An aminophosphonate derivative of a vinca alkaloid with potential antineoplastic activity. Vinfosiltine exerts its antineoplastic action just like its parent compound, vinblastine, by immobilizing tubulin molecules, thereby interrupting microtubule assembly\u002Fdisassembly dynamics. As a result, vinfosiltine prevents mitotic spindle formation and leads to cell cycle arrest in metaphase.",fdaUniiCode:"AW1UYE6Q9I",identifier:"C2378",preferredName:a,semanticType:"Organic Chemical",subclassOf:["C67422","C932"],synonyms:["S12363","VINFOSILTINE","Vincaleukoblastine, O4-Deacetyl-3-de(methoxycarbonyl)-3-(((1-(diethoxyphosphinyl)-2-methylpropyl)amin)carbonyl)-,(3(S))-,Sulfate(Salt)",a]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FVinfosiltine",extension:".json",createdAt:b,updatedAt:b}}],fetch:{},mutations:void 0}}("Vinfosiltine","2021-10-30T13:37:35.903Z")));